// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./WishToken.sol";
import "./Exponential.sol";

contract Comptroller is Ownable, Exponential {
    WishToken public token;

    uint256 public ethToTokenExchangeRate;

    constructor(uint256 _exchangeRate) payable Ownable() {
        ethToTokenExchangeRate = _exchangeRate; 
        token = new WishToken();
        _mintToken(msg.sender, msg.value);
    }


    function purchase() public payable {
        _mintToken(msg.sender, msg.value);
    }

    function withdraw() public {

    }


    function _mintToken(address user, uint256 amount) internal virtual {
        require(amount > 0, "must provider eth greater than 0");
        uint256 ethValue = mul_(amount, ethToTokenExchangeRate);

        uint256 mintValue = mul_(ethValue, token.decimals());

        token.mint(user, mintValue);
    }


    function getExchangeRate() public view returns (uint256) {
        uint256 totalTokens = token.totalSupply();
        address eoa = address(this);
        uint256 balance = eoa.balance;

        return div_(totalTokens, balance);
    }
}
